  const [booking, setBooking] = useState([]);
  const flightid = useRecoilValue(AdminFlightId);
  useEffect(() => {
    axios
      .post("/admin/flightbooking", { id: flightid })
      .then((result) =>{ setBooking(result.data.result)
        console.log(result)
    })
      .catch((err) => console.log(err));
  }, []);
  return (
    <div>
      {booking.map((b, i) => (
        <TicketDetails booking={b} />
      ))}
    </div>
  );
};
